import React from "react";
import {
 BrowserRouter as Router,
 Routes,
 Route
} from "react-router-dom";
import Home from "./pages/index"
import Battle from "./pages/battle"

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="battle" element={<Battle />} />
      </Routes>
    </Router>
  );
}

export default App;


